import React, { useState } from "react";

// Dummy Navbar and Footer components (replace with your actual ones)
const Navbar = () => (
  <nav style={{ background: "#4b0082", color: "white", padding: "10px" }}>
    <h2>Admin Panel</h2>
  </nav>
);

const Footer = () => (
  <footer style={{ background: "#4b0082", color: "white", padding: "10px", marginTop: "20px" }}>
    <p>© 2025 Admin Dashboard</p>
  </footer>
);

// Slider Component
const Slider = () => {
  const slides = [
    "Welcome to Admin Dashboard",
    "Manage Users",
    "View Reports",
    "Settings"
  ];
  const [currentIndex, setCurrentIndex] = useState(0);

  const nextSlide = () => setCurrentIndex((currentIndex + 1) % slides.length);
  const prevSlide = () =>
    setCurrentIndex((currentIndex - 1 + slides.length) % slides.length);

  return (
    <div style={{ display: "flex", alignItems: "center", justifyContent: "center", margin: "20px 0" }}>
      <button onClick={prevSlide} style={buttonStyle}>◀</button>
      <div style={slideStyle}>{slides[currentIndex]}</div>
      <button onClick={nextSlide} style={buttonStyle}>▶</button>
    </div>
  );
};

const buttonStyle = {
  backgroundColor: "#4b0082",
  color: "white",
  border: "none",
  padding: "10px 15px",
  margin: "0 10px",
  borderRadius: "5px",
  cursor: "pointer"
};

const slideStyle = {
  backgroundColor: "#dcd6f7",
  color: "#4b0082",
  padding: "30px",
  borderRadius: "10px",
  minWidth: "300px",
  textAlign: "center",
  fontSize: "1.2rem"
};

// AdminDashboard
const AdminDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  return (
    <div style={{ display: "flex" }}>
      {/* Sidebar */}
      <div
        style={{
          width: sidebarOpen ? "250px" : "60px",
          transition: "width 0.3s",
          backgroundColor: "#4b0082",
          color: "white",
          height: "100vh",
          padding: "10px",
          boxSizing: "border-box"
        }}
      >
        <button
          onClick={toggleSidebar}
          style={{
            backgroundColor: "#6a0dad",
            border: "none",
            color: "white",
            padding: "10px",
            width: "100%",
            cursor: "pointer",
            marginBottom: "10px"
          }}
        >
          {sidebarOpen ? "Close" : "≡"}
        </button>

        {sidebarOpen && (
          <div>
            <h4>Profile</h4>
            <p><strong>Name:</strong> Admin Name</p>
            <p><strong>Email:</strong> admin@example.com</p>
            <p><strong>Role:</strong> Admin</p>
          </div>
        )}
      </div>

      {/* Main Content */}
      <div style={{ flex: 1, padding: "20px" }}>
        <Navbar />

        {/* Slider */}
        <Slider />

        <h1>Admin Dashboard</h1>

        <Footer />
      </div>
    </div>
  );
};

export default AdminDashboard;
